const Title = (props) => {
  return <h1>{props.text}</h1>;
};

const Heading = (props) => {
  return (
    <div>
      <h1>{props.title}</h1>
      <h2>{props.subtitle}</h2>
    </div>
  );
};

const ImageView = (props) => {
  return (
    <figure>
      <img src={props.src} />
      <figcaption>{props.caption}</figcaption>
    </figure>
  );
};

const SimpleGallery = (props) => {
  return (
    <div>
      {props.images.map((src) => (
        <img src={src}></img>
      ))}
    </div>
  );
};

const TodoItem = (props) => {
  return <p style={{ textDecoration: "line-through" }}>{props.title}</p>;
};

export { Title, Heading, ImageView, SimpleGallery, TodoItem };
